SELECT MAX("catery"."catery_code" + "charge"."statement_no") as agg_0 FROM "charge" LEFT OUTER JOIN "catery" ON "charge"."catery_no" = "catery"."catery_no" LEFT OUTER JOIN "member" ON "charge"."member_no" = "member"."member_no" LEFT OUTER JOIN "region" ON "member"."region_no" = "region"."region_no"  WHERE "catery"."catery_no" BETWEEN 15 AND 26 AND "member"."corp_no" >= 379.15378315677486 AND "catery"."catery_desc" NOT LIKE '%Su%pplies%' AND "catery"."catery_code" BETWEEN nan AND nan AND "catery"."catery_desc" NOT LIKE '%Communication%'